import React from "react";
import { PageMain } from "core";
import NotificationSystem from 'react-notification-system'
import ClosingRequestSection from '../../sections/closingRequestSection'

export default class ClosingRequest extends React.Component
{
    constructor(props)
    {
        super(props);
        this.requestId = this.props.match.params.requestId;
        this.requestName = this.props.match.params.name;
        this.state = { };
        this.notificationSystem = React.createRef();
    }

    // Events.
    render()
    {
        return <>
                <PageMain
                    title='مختومه کردن درخواست ها'
                    icon="article-off"
                    context={ this }
                    footerLinks={[
                    { href: "/", text: "صفحه اصلی" },
                    { href: "https://banksepah.ir", text: "وب سایت رسمی بانک سپه" },
                    ]}>
                        <ClosingRequestSection requestId={ this.requestId } requestName={ this.requestName }/>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>;
    }
}
